<!doctype html>
<html class="crypt-html">
<head>
    <meta charset="utf-8">
    <title>Very protected page</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">

    <!-- do not cache this page -->
    <meta http-equiv="cache-control" content="max-age=0"/>
    <meta http-equiv="cache-control" content="no-cache"/>
    <meta http-equiv="expires" content="0"/>
    <meta http-equiv="expires" content="Tue, 01 Jan 1980 1:00:00 GMT"/>
    <meta http-equiv="pragma" content="no-cache"/>

    <style>
        .crypt-hr {
            margin-top: 20px;
            margin-bottom: 20px;
            border: 0;
            border-top: 1px solid #eee;
        }

        .crypt-page {
            width: 360px;
            padding: 8% 0 0;
            margin: auto;
            box-sizing: border-box;
        }

        .crypt-form {
            position: relative;
            z-index: 1;
            background: #FFFFFF;
            max-width: 360px;
            margin: 0 auto 100px;
            padding: 45px;
            text-align: center;
            box-shadow: 0 0 20px 0 rgba(0, 0, 0, 0.2), 0 5px 5px 0 rgba(0, 0, 0, 0.24);
        }

        .crypt-form input[type="password"] {
            outline: 0;
            background: #f2f2f2;
            width: 100%;
            border: 0;
            margin: 0 0 15px;
            padding: 15px;
            box-sizing: border-box;
            font-size: 14px;
        }

        .crypt-form .crypt-decrypt-button {
            text-transform: uppercase;
            outline: 0;
            background: #4CAF50;
            width: 100%;
            border: 0;
            padding: 15px;
            color: #FFFFFF;
            font-size: 14px;
            cursor: pointer;
        }

        .crypt-form .crypt-decrypt-button:hover, .crypt-form .crypt-decrypt-button:active, .crypt-form .crypt-decrypt-button:focus {
            background: #43A047;
        }

        .crypt-html {
            height: 100%;
        }

        .crypt-body {
            height: 100%;
            margin: 0;
        }

        .crypt-content {
            height: 100%;
            margin-bottom: 1em;
            background: #76b852; /* fallback for old browsers */
            background: -webkit-linear-gradient(right, #b852b2, #8DC26F);
            background: -moz-linear-gradient(right, #b852b2, #8DC26F);
            background: -o-linear-gradient(right, #b852b2, #8DC26F);
            background: linear-gradient(to left, #b852b2, #8DC26F);
            font-family: "Arial", sans-serif;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
        }

        .crypt-instructions {
            margin-top: -1em;
            margin-bottom: 1em;
        }

        .crypt-title {
            font-size: 1.5em;
        }

        .hidden {
            display: none !important;
        }

        .crypt-spinner-container {
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .crypt-spinner {
            display: inline-block;
            width: 2rem;
            height: 2rem;
            vertical-align: text-bottom;
            border: 0.25em solid gray;
            border-right-color: transparent;
            border-radius: 50%;
            -webkit-animation: spinner-border .75s linear infinite;
            animation: spinner-border .75s linear infinite;
            animation-duration: 0.75s;
            animation-timing-function: linear;
            animation-delay: 0s;
            animation-iteration-count: infinite;
            animation-direction: normal;
            animation-fill-mode: none;
            animation-play-state: running;
            animation-name: spinner-border;
        }

        @keyframes spinner-border {
            100% {
                transform: rotate(360deg);
            }
        }
    </style>
</head>

<body class="crypt-body">

<div id="crypt_loading" class="crypt-spinner-container">
    <div class="crypt-spinner"></div>
</div>

<div id="crypt_content" class="crypt-content hidden">
    <div class="crypt-page">
        <div class="crypt-form">
            <div class="crypt-instructions">
                <p class="crypt-title">Very protected page</p>
                <p></p>
            </div>

            <hr class="crypt-hr">

            <form id="crypt-form" action="#" method="post">
                <input id="crypt-password"
                       type="password"
                       name="password"
                       placeholder="Password"
                       autofocus/>

                <input type="submit" class="crypt-decrypt-button" value="DECRYPT"/>
            </form>
        </div>

    </div>
</div>
